import './App.css';
import Home from './components/home/home';
import About from './components/about/about';
function App() {
  return (
    <div>
    <div className="row">
        <div className="col-xs-offset-2 col-xs-8">
            <div className="page-header"><h2>React Router Demo</h2></div>
        </div>
    </div>
    <div className="row">
        <div className="col-xs-2 col-xs-offset-2">
            <div className="list-group">
                {/* 设置路由链接 */}
                <Link className="list-group-item active" to="./components/about">About</Link>
                <Link className="list-group-item active" to="./components/home">home</Link>
            </div>
        </div>
        <div className="col-xs-6">
            <div className="panel">
                <div className="panel-body">
                    <Home/>
                    <About/>
                </div>
            </div>
        </div>
    </div>
</div>
  );
}

export default App;
